var title_f38_62_39908="Timing of late preterm or early term birth";
var content_f38_62_39908=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F52580&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F52580&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    Timing of late preterm or early term birth: Balancing the risks of pregnancy continuation and delivery before term",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 366px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Conceptual diagram representing the competing risks and benefits of indicated late-preterm or early-term birth compared with pregnancy continuation. The figure does not represent specific magnitudes or rates of changes in risks because these will vary according to the specific pregnancy complication and individual circumstances. Neonatal morbidity and mortality decreases with advancing gestation; these typically are related to prematurity. For these deliveries in the late-preterm or early-term period, maternal morbidity and mortality generally are higher as a result of prolonged or failed induction and resultant cesarean deliveries. Potential maternal consequences of continued pregnancy in the setting of complicated conditions and maternal morbidity and mortality are related to hemorrhage, hypertensive crises, and uterine rupture. Continued pregnancy in these settings also can result in fetal morbidity and stillbirth due to uteroplacental insufficiency.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Spong CY, Mercer BM, D'Alton M, et al. Timing of indicated late-preterm and early-term birth. Obstet Gynecol 2011; 118:323. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
