var title_f38_62_39917="Cisplatin and etoposide for relapsed germ cell tumors";
var content_f38_62_39917=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F63222&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F63222&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cisplatin and etoposide for relapsed germ cell tumors",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 21 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cisplatin",
"        </strong>",
"       </td>",
"       <td>",
"        20 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV per day",
"       </td>",
"       <td>",
"        Dilute with 250 mL normal saline (NS) and administer over one hour. Do not administer with aluminum needles or intravenous sets.",
"       </td>",
"       <td>",
"        Days 1 through 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Etoposide",
"        </strong>",
"       </td>",
"       <td>",
"        100 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV per day",
"       </td>",
"       <td>",
"        Dilute with 500 mL NS (concentration less than 0.4 mg/mL) and administer over one hour.",
"       </td>",
"       <td>",
"        Days 1 through 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Induction of diuresis using intravenous NS minimizes the risk of cisplatin nephrotoxicity. At least 2000 mL of NS should be administered at a rate of 100 to 125 mL per hour throughout the five days of treatment and continued for at least two hours after the last dose of cisplatin. Refer to UpToDate topic on \"Cisplatin nephrotoxicity\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        HIGH (&gt;90 percent frequency of emesis). Aprepitant can be given orally (125 mg on day 1, 80 mg on days 2 and 3) with ondansetron, prochlorperazine, and dexamethasone daily. Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Bost cisplatin and etoposide are irritants. Cisplatin can cause significant tissue damage; avoid extravasation",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topic on \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Primary prophylaxis with granulocyte colony stimulating factors is not indicated. Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        Treatment in the setting of baseline renal dysfunction (creatinine &gt;3.0 mg/dL or GFR &lt;50 mL/min) requires a balanced discussion of the goals of treatment and the risks of administering cisplatin",
"        <sup>",
"         [3]",
"        </sup>",
"        . Refer to UpToDate topics on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential weekly during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Basic metabolic panel (creatinine and electrolytes) prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Liver function tests prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor vital signs during etoposide infusion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for neurotoxicity; monitor for hearing loss prior to each dose of cisplatin; audiometry as clinical indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        Each cycle should begin on schedule regardless of the degree of myelosuppression",
"        <sup>",
"         [1]",
"        </sup>",
"        . If febrile neutropenia or thrombocytopenic bleeding occurs, a dose reduction of 25 percent for etoposide should be used for subsequent cycles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neurologic toxicity:",
"        </strong>",
"        Neuropathy usually is seen after cumulative doses of cisplatin beyond 400 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        , although there is marked interindividual variation. Patients with mild neuropathy can continue to receive full cisplatin doses. However, if the neuropathy interferes with function, the risk of potentially disabling neurotoxicity must be weighed against the benefit of continued treatment. Refer to UpToDate topic on \"Neurologic complications of platinum-based chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Renal toxicity:",
"        </strong>",
"        It is recommended that subsequent doses of cisplatin be withheld until the serum creatinine is less than 3.0 mg/dL.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; GFR: glomerular filtration rate; CBC: complete blood count.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Loehrer PJ, et al. J Clin Oncol 1995; 13:470.",
"      </li>",
"      <li>",
"       Platinol (cisplatin) injection, powder, lyophilized, for solution. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 20, 2011).",
"      </li>",
"      <li>",
"       Toposar (etoposide) injection. US FDA-approved package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed December 20, 2011).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
